// src/components/LoginButton.js
import React from 'react';
import { useKeycloak } from '@react-keycloak/web';

const LoginButton = () => {
  const { keycloak } = useKeycloak();

  const handleLogin = () => {
    keycloak.login();
  };

  return (
    <button onClick={handleLogin}>
      Login com Keycloak
    </button>
  );
};

export default LoginButton;
